import React from 'react';
import {Switch,Route } from 'react-router-dom';
import Home from './Component/Home';
import About from './Component/About';

const App=()=>{
  return(
    <>
<Switch>
  <Route path="/" component={Home}/>
  <Route path="/about" component={About}/>
</Switch>
    </>
  )
}
export default App;
